import React, { useState } from 'react';

import './css/style.css';
import { datauser } from './data';
import DataCount from "./componenets/datacount"
import Listuser from './componenets/listUser';
import Btn from './componenets/btn';

const App = () => {
      let [data, setdata] = useState(datauser)

      let deleteItem = () => {
            setdata([])
      }
      return (
            <div>
                  <div className='container'>
                     <DataCount count={data.length}></DataCount>
                        <Listuser count={data.l} data={data}></Listuser>
                        <Btn evantdelete={deleteItem}></Btn>
                  </div>
            </div>
      )
}


export default App
